let htmlArrows;
let htmlReservation;
let htmlExtraInfo;
let htmlPopup;
let htmlBackground;
let htmlPopupCancel;
let htmlPopupTerug;
let execute = true;

function DisplayNone() {
    htmlPopup.style = "display: none;"
    execute = true;
}

function ListenToCancel() {
    htmlPopupCancel.addEventListener('click', function () {
        htmlBackground.style = ""
        htmlPopup.style.animation = "fadeout 0.3s"
        setTimeout(DisplayNone, 300)
    })
}

function ListenToDelete() {
    htmlPopupOpen.addEventListener('click', function () {
        htmlBackground.style = ""
        htmlPopup.style.animation = "fadeout 0.3s"
        if (execute) {
            console.log('Verwijder dit item')
            execute = false
        }
        setTimeout(DisplayNone, 300)
    })
}

function ListenToCLickEditDelete() {
    let htmlDeleteIcons = document.querySelectorAll('.js-deleteicon')
    for (let htmlDeleteIcon of htmlDeleteIcons) {
        htmlDeleteIcon.addEventListener('click', function () {
            htmlPopup.style = "display:block"
            htmlPopup.style.animation = "fadein 0.5s"
            htmlBackground.style = "filter: blur(8px);"
            ListenToCancel();
            ListenToDelete();
        })
    }
}

function ListenToClickArrowMore() {
    for (let htmlArrow of htmlArrows) {
        htmlArrow.addEventListener('click', function () {
            htmlReservation = htmlArrow.parentNode;
            htmlExtraInfo = htmlReservation.nextElementSibling;
            if (htmlExtraInfo.innerHTML == '') {
                htmlReservation.classList.add("reservation_more_border")
                htmlArrow.style.transform = 'rotate(180deg)';
                console.log('Open klappen');
                htmlExtraInfo.innerHTML = `<div class="reservation_details">
                <div class=" reservation_details_edit_and_delete flex">
                    <div class="reservation_details_edit flex centerflex">
                        <svg class="js-editicon editicon" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="24" height="24" viewbox="0 0 24 24">
                            <defs>
                                <pattern id="patternedit" preserveaspectratio="xMidYMid slice" width="100%" height="100%" viewbox="0 0 512 512">
                                    <image width="512" height="512" xlink:href="data:image/png;base64,"/>
                                </pattern>
                            </defs>
                            <rect id="editing" width="24" height="24" fill="url(#patternedit)"/>
                        </svg>
                    </div>
                    <div class="reservation_details_delete flex centerflex">
                        <svg class="js-deleteicon deleteicon" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="24" height="24" viewbox="0 0 24 24">
                            <defs>
                                <pattern id="patternbin" preserveaspectratio="xMidYMid slice" width="100%" height="100%" viewbox="0 0 512 512">
                                    <image width="512" height="512" xlink:href="data:image/png;base64,"/>
                                </pattern>
                            </defs>
                            <rect id="bin" width="24" height="24" fill="url(#patternbin)"/>
                        </svg>
                    </div>
                </div>
                <div class="reservation_detail flex">
                    <p class="reservation_detail_title">Tijdslot</p>
                    <p class="reservation_detail_content">14:15-15:30</p>
                </div>
                <div class="reservation_detail flex">
                    <p class="reservation_detail_title">Geopend</p>
                    <p class="reservation_detail_content">14:16</p>
                </div>
                <div class="reservation_detail flex">
                    <p class="reservation_detail_title">Teruggebracht</p>
                    <p class="reservation_detail_content">15:32</p>
                </div>
                <div class="reservation_detail flex">
                    <p class="reservation_detail_title">Sport</p>
                    <p class="reservation_detail_content">Voetbal</p>
                </div>
                <div class="reservation_opmerking">
                    <p class="reservation_opmerking_title">Opmerking</p>
                    <p class="reservation_opmerking_content">Tijdens het spelen is de bal kapotgegaan door een botsing met een stuk glas</p>
                </div>
            </div>`;
                htmlExtraInfo.style.animation = 'fadein 0.5s'
                ListenToCLickEditDelete()
                return;
            } else {
                htmlReservation.classList.remove("reservation_more_border")
                htmlArrow.style.transform = 'rotate(0deg)';
                console.log('Dicht klappen')
                htmlExtraInfo.innerHTML = ``;
                htmlExtraInfo.style.animation = ''
                ListenToCLickEditDelete()
                return;
            }
        })
    }
}
function init() {
    console.log('Dom geladen')
    htmlArrows = document.querySelectorAll('.js-arrow_more')
    htmlPopup = document.querySelector('.js-popup')
    htmlBackground = document.querySelector('.js-background')
    htmlPopupCancel = document.querySelector('.js-popup-cancel')
    htmlPopupOpen = document.querySelector('.js-popup-open')
    ListenToClickArrowMore()
}
document.addEventListener('DOMContentLoaded', init)
